INSERT INTO `field_body` (pages_id, data) VALUES('1', '<p class=\"lead\">ProcessWire is a free php5 content management system and framework (Open source CMS/CMF). Specialy build to save your time and the work you would do. ProcessWire gives simpler and stronger control over your pages, fields, templates and markup at any scale. </p><h2>It is Faster, Stronger, Simple, Powerful and Fun</h2><p>Managing a site in ProcessWire is shockingly easy and fun compared to what you may be used to. Please visit more about <a href=\"http://processwire.com\" target=\"_blank\">processwire</a> from the official website.</p>');
